Charley Boorman's Extreme Frontiers: Canada

Travel Documentary hosted by Charley Boorman, published by Channel 5 in 2012 - English narration


Information
------------------------------

Charley Boorman's Extreme Frontiers: Canada
Charley Boorman is back on his bike exploring the world's second largest country - home to some of the most stunning and challenging terrain known to man. Canada is a country of extremes, and Charley knows all about pushing the limits. He goes dirt biking in New Brunswick, dives through old shipwrecks in Tobermory and rides along Butch Cassidy's old Outlaw Trail. He also meets a fascinating mix of people on his journey. As he heads across Canada, he plays ice hockey with a legend of the game; spends a day as a Mountie cadet and nearly meets a ghost in Winnipeg . . .


1)  1 
Charley begins his adventure in the most easterly point of Newfoundland, where he sees a huge iceberg in the rough Atlantic seas. He later sees a sombre reminder of the Titanic's fate and tackles a tidal bore wave head on.

2)  2 
Charley makes his way through the Big Muddy Badlandsas he stops at Lively. He then travels further west along the world's longest street, which is almost 1,200 miles long to Winnipeg where he sleeps at Canada's most haunted hotel. He then meets up with some Mounties and takes part in a training mission, before enjoying the Canada Day celebrations. He then takes part in a rodeo in Saskatchewan.

3)  3 
Charley makes his way through Alberta where he finds out about cowboys at the Rafter Six Ranch. He is then forced to face one of his worse fears when armed with just a rope and a guide; he has to climb to the top of Mount Fable.

4)  4 
Charley concludes his adventure as he makes his way towards the Pacific coast. He gets the chance to pilots a small plane to Dawson City and takes a look around a goldmine that has been running since the days of the gold rush.

5)  5 
